import Navbar from "../../components/Navbar/Navbar"
import Header from "../../components/Header/Header"
import React, { Component } from 'react'
import Calendar from "react-calendar"

export default class Home extends Component {
  render() {
    return (
    <div>
        <Navbar/>
        <Header pos="Home"/>
        <div>Home</div>
        <Calendar/>
    </div>
    )
  }
}
